import MainHeader from "./components/Home/MainHeader";
import React from "react";
import HomePage from "./components/Home/HomePage";
import Rengoku from "./components/Home/HashiraPages/Rengoku";
import { Route, Routes } from "react-router-dom";

function App() {
  // return (
  //   <React.Fragment>
  //     <HomePage />
  //   </React.Fragment>
  // );
  return(
    <React.Fragment>
      <Routes>
        <Route path='/' element={<HomePage/>}> </Route>
        <Route path='/Rengoku' element={<Rengoku/>}></Route>
      </Routes>
    </React.Fragment>
  )
}

export default App;
